import HtmlGameMainView from "@/components/Dashboard/GameComponents/HtmlMission/HtmlGameMainView.vue"
import HtmlLvl1 from "@/components/Dashboard/GameComponents/HtmlMission/HtmlLvl1.vue"
import HtmlLvl2 from "@/components/Dashboard/GameComponents/HtmlMission/HtmlLvl2.vue"
export default[
    {
        path:'/html-game',
        component:HtmlGameMainView,
    },
    {
        path:'/html-game/lvl-1',
        component:HtmlLvl1
    },
    {
        path:'/html-game/lvl-2',
        component:HtmlLvl2
    },
]
